import React from 'react';
import Navigation from '../components/Navigation';
import ScootRushTimeline from '../components/ScootRushTimeline';

const scootrush = () => {
  return (
    <div className="Scootrush">
      <Navigation />
      <div className="ScootrushContent">
      <ScootRushTimeline />
      scootrush
      </div>
    </div>
  );
};

export default scootrush;
